package logic;

public class Position {
	protected double x;
	protected double y;
	
	public Position(double x2, double y2) {
		super();
		this.x = x2;
		this.y = y2;
	}

	public double getX() {
		return  x;
	}

	public void setX(double d) {
		this.x = d;
	}
	
	public double getY() {
		return y;
	}

	public void setY(double d) {
		// TODO Auto-generated method stub
		this.y = d;
	}
}
